import MainSecTitleCTA from "./MainSecTitleCTA";
import MainSecVideoCTA from "./MainSecVideoCTA";
import MainSecButtonCTA from "./MainSecButtonCTA";
import { GlobalSection } from "../../stylesGlobal";
import { styled } from "styled-components";

const Div = styled.div`
    margin: 0 1rem;
`

function Section02() {
    return (
        <GlobalSection>
            <MainSecTitleCTA />
            <Div>
                <MainSecVideoCTA />
            </Div>
            <MainSecButtonCTA />
        </GlobalSection>
    )
};

export default Section02;
